import React, {useMemo, useState} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'
import Header from "./components/Header";
import Pages from "./containers/pages";
import {BrowserRouter} from "react-router-dom";

function App() {

    return (
        <BrowserRouter>
            <div className="App">
                <Header/>
                <Pages/>
            </div>
        </BrowserRouter>
    );
}

export default App;
